import { Table } from "antd"
import React, { useState } from 'react';
import { Form, Row, Col, Input, Button } from 'antd';
import { DownOutlined, UpOutlined } from '@ant-design/icons';

const layout = {
    labelCol: {
        span: 1,
    },
    wrapperCol: {
        span: 3,
    },
};
const tailLayout = {
    wrapperCol: {
        offset: 1,
        span: 3,
    },
};



const dataSource = [
    {
        key: '1',
        scriptCode: '胡彦斌',
        scriptName: 32,
        runningState: '西湖区湖底公园1号',
        theResults: "成功",
        lastRunTime: "11-0-1",
        tunButton: (<button>运行</button>),
        open: (<button>打开</button>),
        description: '这是脚本的详情'
    },
    {
        key: '2',
        scriptCode: '胡彦祖',
        scriptName: 42,
        runningState: '西湖区湖底公园1号',
        theResults: "成功",
        lastRunTime: "11-0-1",
        tunButton: (<button>运行</button>),
        open: (<button>打开</button>)
    },
];

const columns = [
    {
        title: '脚本编号',
        dataIndex: 'scriptCode',
        key: 'scriptCode',
    },
    {
        title: '脚本名称',
        dataIndex: 'scriptName',
        key: 'scriptName',
    },
    {
        title: '运行状态',
        dataIndex: 'runningState',
        key: 'runningState',
    },
    {
        title: '运行结果',
        dataIndex: 'theResults',
        key: 'theResults',
    },
    {
        title: "上次运行时间",
        dataIndex: "lastRunTime",
        key: "lastRunTime"
    },
    {
        dataIndex: "tunButton",
        key: "tunButton"
    },
    {
        dataIndex: "open",
        key: "open"
    }
];

function AutomaticInvestment() {
    const onFinish = (values) => {
        console.log('Success:', values);
    };

    const onFinishFailed = (errorInfo) => {
        console.log('Failed:', errorInfo);
    };
    return (
        <div>
            <div>
                <div>
                    上次运行成功
                    <span>1</span>
                </div>
                <div>
                    上次运行失败
                    <span>1</span>
                </div>
            </div>
            return (
            <Form
                {...layout}
                name="basic"
                initialValues={{
                    remember: true,
                }}
                onFinish={onFinish}
                onFinishFailed={onFinishFailed}
            >
                <Form.Item
                    label="脚本编号"
                    name="scriptCode"
                >
                    <Input />
                </Form.Item>

                <Form.Item
                    label="运行结果"
                    name="theResults"
                >
                    <Input.Password />
                </Form.Item>
                <Form.Item
                    label="运行状态"
                    name="runningState"
                >
                    <Input.Password />
                </Form.Item>
                <Form.Item {...tailLayout}>
                    <Button type="primary" htmlType="submit">
                        查询
                    </Button>
                </Form.Item>
            </Form>
            <Table
                expandable={{
                    expandRowByClick: true,
                    expandedRowRender: record => (
                        <div>{record.description}</div>
                    ),
                    rowExpandable: record => record.name !== 'Not Expandable',
                }}
                dataSource={dataSource}
                columns={columns} />
        </div>

    )
}

export default AutomaticInvestment
